export default class PostHeader extends Component {
  render() {
    return (
        <div style={{backgroundColor: "purple"}}>
            <h3>{this.props.post.name}</h3>
            <p>{this.props.post.body}</p>
            <button> See Full Post </button>
        </div>
    );
  }
}
